package com.lti.dto;

public class SelectFlightDto {

	
		// TODO Auto-generated constructor stub
		int flightNo;
		String flightName;
		String from;
		String to;
		String departure;
		String arrival;
		String duration;
		int cabinSize;
		int costEconomy;
		int costBusiness;
		public int getFlightNo() {
			return flightNo;
		}
		public void setFlightNo(int flightNo) {
			this.flightNo = flightNo;
		}
		public String getFlightName() {
			return flightName;
		}
		public void setFlightName(String flightName) {
			this.flightName = flightName;
		}
		public String getFrom() {
			return from;
		}
		public void setFrom(String from) {
			this.from = from;
		}
		public String getTo() {
			return to;
		}
		public void setTo(String to) {
			this.to = to;
		}
		public String getDeparture() {
			return departure;
		}
		public void setDeparture(String departure) {
			this.departure = departure;
		}
		public String getArrival() {
			return arrival;
		}
		public void setArrival(String arrival) {
			this.arrival = arrival;
		}
		public String getDuration() {
			return duration;
		}
		public void setDuration(String duration) {
			this.duration = duration;
		}
		public int getCabinSize() {
			return cabinSize;
		}
		public void setCabinSize(int cabinSize) {
			this.cabinSize = cabinSize;
		}
		public int getCostEconomy() {
			return costEconomy;
		}
		public void setCostEconomy(int costEconomy) {
			this.costEconomy = costEconomy;
		}
		public int getCostBusiness() {
			return costBusiness;
		}
		public void setCostBusiness(int costBusiness) {
			this.costBusiness = costBusiness;
		}


}
